CKEDITOR.plugins.setLang("a11yhelp","pl",{title:"Instrukcje dostpnoci",contents:"Zawarto pomocy. Wcinij ESC, aby zamkn to okno.",legend:[{name:"Oglne",items:[{name:"Pasek narzdzi edytora",legend:"Wcinij ${toolbarFocus} aby przej do paska narzdzi. Przejd do nastpnej i poprzedniej grupy narzdzi uywajc TAB oraz SHIFT-TAB. Przejd do nastpnego i poprzedniego narzdzia uywajc STRZAKI W PRAWO lub STRZAKI W LEWO. Wcinij SPACJ lub ENTER, aby aktywowa zaznaczone narzdzie."},{name:"Okno dialogowe",
legend:"Bdc w oknie dialogowym wcinij TAB aby przej do nastpnego pola dialogowego, wcinij SHIFT + TAB aby przej do poprzedniego pola, wcinij ENTER aby wysa dialog, wcinij ESC aby anulowa dialog. Dla okien dialogowych z wieloma zakadkami, wcinij ALT + F10 aby przej do listy zakadek. Gdy to zrobisz przejd do nastpnej zakadki wciskajc TAB lub STRZAK W PRAWO. Przejd do poprzedniej zakadki wciskajc SHIFT + TAB lub STRZAK W LEWO. Wcinij SPACJ lub ENTER aby wybra zakadk."},
{name:"Menu kontekstowe edytora",legend:"Wcinij ${contextMenu} lub PRZYCISK APLIKACJI aby otworzy menu kontekstowe. Przejd do nastpnej pozycji menu wciskajc TAB lub STRZAK W D. Przejd do poprzedniej pozycji menu wciskajc SHIFT + TAB lub STRZAK W GR. Wcinij SPACJ lub ENTER aby wygra pozycj menu. Otwrz pod-menu obecnej pozycji wciskajc SPACJ lub ENTER lub STRZAK W PRAWO. Wr do pozycji nadrzdnego menu wciskajc ESC lub STRZAK W LEWO. Zamknij menu wciskajc ESC."},{name:"Editor List Box",
legend:"Inside a list-box, move to next list item with TAB OR DOWN ARROW. Move to previous list item with SHIFT + TAB or UP ARROW. Press SPACE or ENTER to select the list option. Press ESC to close the list-box."},{name:"Editor Element Path Bar",legend:"Press ${elementsPathFocus} to navigate to the elements path bar. Move to next element button with TAB or RIGHT ARROW. Move to previous button with  SHIFT+TAB or LEFT ARROW. Press SPACE or ENTER to select the element in editor."}]},{name:"Polecenia",
items:[{name:"Cofnij polecenie",legend:"Wcinij ${undo}"},{name:"Ponw polecenie",legend:"Wcinij ${redo}"},{name:"Polecenie pogrubienia",legend:"Wcinij ${bold}"},{name:"Polecenie kursywy",legend:"Wcinij ${italic}"},{name:"Polecenie podkrelenia",legend:"Wcinij ${underline}"},{name:"Polecenie hipercza",legend:"Wcinij ${link}"},{name:"Polecenie schowaj pasek narzdzi",legend:"Wcinij ${toolbarCollapse}"},{name:" Access previous focus space command",legend:"Press ${accessPreviousSpace} to access the closest unreachable focus space before the caret, for example: two adjacent HR elements. Repeat the key combination to reach distant focus spaces."},
{name:" Access next focus space command",legend:"Press ${accessNextSpace} to access the closest unreachable focus space after the caret, for example: two adjacent HR elements. Repeat the key combination to reach distant focus spaces."},{name:"Pomoc dostpnoci",legend:"Wcinij ${a11yHelp}"}]}]});
