CKEDITOR.plugins.setLang("a11yhelp","pt-br",{title:"Instrues de Acessibilidade",contents:"Contedo da Ajuda. Para fechar este dilogo pressione ESC.",legend:[{name:"Geral",items:[{name:"Barra de Ferramentas do Editor",legend:"Pressione ${toolbarFocus} para navegar para a barra de ferramentas. Mova para o anterior ou prximo grupo de ferramentas com TAB e SHIFT-TAB. Mova para o anterior ou prximo boto com SETA PARA DIREITA or SETA PARA ESQUERDA. Pressione ESPAO ou ENTER para ativar o boto da barra de ferramentas."},
{name:"Dilogo do Editor",legend:"Dentro de um dilogo, pressione TAB para navegar para o prximo campo, pressione SHIFT + TAB para mover para o campo anterior, pressione ENTER para enviar o dilogo, pressione ESC para cancelar o dilogo. Para dilogos que tem mltiplas abas, pressione ALT + F10 para navegar para a lista de abas, ento mova para a prxima aba com SHIFT + TAB ou SETA PARA ESQUERDA. Pressione ESPAO ou ENTER para selecionar a aba."},{name:"Menu de Contexto do Editor",legend:"Pressione ${contextMenu} ou TECLA DE MENU para abrir o menu de contexto, ento mova para a prxima opo com TAB ou SETA PARA BAIXO. Mova para a anterior com SHIFT+TAB ou SETA PARA CIMA. Pressione ESPAO ou ENTER para selecionar a opo do menu. Abra o submenu da opo atual com ESPAO ou ENTER ou SETA PARA DIREITA. Volte para o menu pai com ESC ou SETA PARA ESQUERDA. Feche o menu de contexto com ESC."},
{name:"Caixa de Lista do Editor",legend:"Dentro de uma caixa de lista, mova para o prximo item com TAB ou SETA PARA BAIXO. Mova para o item anterior com SHIFT + TAB ou SETA PARA CIMA. Pressione ESPAO ou ENTER para selecionar uma opo na lista. Pressione ESC para fechar a caixa de lista."},{name:"Barra de Caminho do Elementos do Editor",legend:"Pressione ${elementsPathFocus} para a barra de caminho dos elementos. Mova para o prximo boto de elemento com TAB ou SETA PARA DIREITA. Mova para o boto anterior com  SHIFT+TAB ou SETA PARA ESQUERDA. Pressione ESPAO ou ENTER para selecionar o elemento no editor."}]},
{name:"Comandos",items:[{name:" Comando Desfazer",legend:"Pressione ${undo}"},{name:" Comando Refazer",legend:"Pressione ${redo}"},{name:" Comando Negrito",legend:"Pressione ${bold}"},{name:" Comando Itlico",legend:"Pressione ${italic}"},{name:" Comando Sublinhado",legend:"Pressione ${underline}"},{name:" Comando Link",legend:"Pressione ${link}"},{name:" Comando Fechar Barra de Ferramentas",legend:"Pressione ${toolbarCollapse}"},{name:" Access previous focus space command",legend:"Press ${accessPreviousSpace} to access the closest unreachable focus space before the caret, for example: two adjacent HR elements. Repeat the key combination to reach distant focus spaces."},
{name:"Acessar prximo fomando de spao de foco",legend:"Pressione ${accessNextSpace} para acessar o espao de foco no alcanvel mais prximo aps o cursor, por exemplo: dois elementos HR adjacentes. Repita a combinao de teclas para alcanar espaos de foco distantes."},{name:" Ajuda de Acessibilidade",legend:"Pressione ${a11yHelp}"}]}]});
